import logo1 from "../icons/gologo.png";
import logo2 from "../icons/ginLogo.svg";

function Content_Homepage() {
  return (
    <div className=" w-1/2 h-96 bg-slate-300 mx-auto pt-10">
      <div className="text-center font-bold text-lg">
        Mi stack de tecnologias
      </div>
      <div className="flex justify-evenly">
        <span>Go y Gin Gonic</span>
        <div className="pt-10 pr-10 font-medium text-justify ">
          Uso golang por las librerias tan robustas que tiene y las cosas que me
          permiten hacer incluso sin framework pero actualmente uso gin gonic
          que mejora mis tiempos de desarrollo
        </div>
        <div className="pt-10 ">
          <img className="w-40" src={logo1}></img>
        </div>
        <div>
          <img className="pt-6 w-28" src={logo2}></img>
        </div>
      </div>
    </div>
  );
}

export default Content_Homepage;
